import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export default class Navbar extends Component {
  render() {
    return (
      <div style={{display:'flex',padding:'0.5',background:'black'}}>
      <Link to='/' style={{textDecoration:'none'}}><h1 style={{textDecoration:'none', color:'white'}}>Movies World</h1></Link>
      <Link to='/favourites' style={{textDecoration:'none'}}><h2 style={{ marginLeft:'2rem',marginTop:'1.5rem',color:'white'}}>favourites</h2></Link>
      </div>
    )
  }
}
